eval("__webpack_require__.r(__webpack_exports__);\n/* harmony export */ __webpack_require__.d(__webpack_exports__, {\n/* harmony export */   \"default\": () => (__WEBPACK_DEFAULT_EXPORT__)\n/* harmony export */ });\nconst messages = {\n    contact: \"Contact\",\n    aboutMe: \"About Me\",\n    firstPhrase: \"In addition to being a <span>developer</span>, I am also an <span>engineer</span>.\\n \",\n    secondPhrase: \"Since high school there has been a strong passion for computer science and technology with a clear goal in mind: \\n\\n to maximize the potential of the <span>tools</span> at hand and improve <span>processes</span>.\",\n    softSkills: \"Soft skills\",\n    communicative: \"Communicative\",\n    spirit: \"Adaptive spirit\",\n    decision: \"Analyst and decision marking\",\n    goal: \"Goal orientation\",\n    cooperative: \"Cooperative\",\n    leadership: \"Leadership\",\n    project: \"Last project\",\n    education: \"Education\",\n    experience: \"Work Experience\",\n    lnccPWA: \"LN-CC Progressive web app\",\n    firstProject: \"I am happy to have been part of <lncc>LN-CC's</lncc> migration project to the new PWA architecture,\" + \" Progressive WebApp.\\n\\nThe headless architecture makes use of Salesforce Commerce API \" + \"( <hglt>Scapi </hglt> )and <hglt>React</hglt>, but we used other tool such as: <hglt>Redux</hglt>,\" + \" data management; <hglt>Typescript</hglt> to increase code quality Contenful, CMS to manage the \" + \" site content, etc. \\n\\nWe worked by writing code following best practices, confirmed by PageSpeed\" + \" Insights which gives a score of 92 on accessibility and 92 on SEO.\",\n    firstExpTitle: \" fullstack developer\",\n    secondExpTitle: \"Trainee Caposettore\",\n    firstShortHeading: \"The Level Group | September 2022 - now\",\n    secondShortHeading: \"Leroy Merlin| September 2019 - September 2020\",\n    firstExpDescription: \"I am handling the management and development of e-commerce in the fashion and luxury industry using Salesforce Commerce Cloud. I am inclined to develop both frontend and backend with various programming languages such as: Javascript, React, Redux, JQuery, Laravel and Node. These languages have been studied over time through training hours that company gives me and from my curiosity to experiment with new methods.\",\n    secondExpDescription: \"Management of department resources (ex: schedules and implementations of ranges/trade operations) to hit the goal; advance rank planning business strategies (analysis of new products, reuse of materials, optimal stock management and increased visibility). Co-construction of store strategy in collaboration with other locations; reshaping organization and sales strategy as a result of Covid-19.\",\n    firstEduTitle: \"Bachelor's Degree in Industrial Engineering\",\n    secondEduTitle: \" Web Developer\",\n    firstEduShortHeading: \"Universit\\xe0 di Catania| October 2013 - December 2018\",\n    secondEduShortHeading: \"Boolean Careers | January 2021 - July 2021\",\n    firstEduDescription: 'Topics subject to further study: electrical engineering; mechanics applied to machines; construction science; thermodynamics; heat transfer; machines and energy systems.\\n\\n Writing of the thesis entitled \"The automotive transmission and its evolutions\" For consultation you can find it at this link',\n    secondEduDescription: \"In this experience, I made challenging projects inspired by famous websites and web apps, such as: Netflix, Whatsapp Web, Spotify Web, and so-many more. \\n\\nThe final project represents a simulation of developing a site similar to Airbnb being part of a team chosen by PM, mainly I was in charge of the backend part and building the advanced search with interactive map insertion with TomTom API calls. \\n\\nFind the BoolB&b project here.\",\n    boolBnBTitle: \"BoolBnB: last project in Boolean - 2021\",\n    boolBnBDescription: \"How to make a map dynamic by using filters? \\nIn my final project at <hglt>Boolean</hglt>, I oversaw the implementation of <hglt>advanced search</hglt> and its integration with the map using TomTom APIs.\\n I'm very happy with the outcome, but I'm aware there's potential for further enhancement! \\uD83D\\uDCAA\",\n    portfolioTitle: \"My Personal Website - 2023\",\n    portfolioDescription: \"Welcome to my portfolio website! Creating this website is an exciting hobby that constantly challenges me to test my abilities. This project encourages me to make decisions and face new challenges.\\n\\nI chose to start the project using <hglt>React</hglt>, the framework I primarily work with, but I decided not to limit myself to my comfort zone. I've introduced some small transitions to enhance the site's user experience, and I'm considering the possibility of integrating <hglt>Three.js</hglt> to create an interactive game. There's even the possibility of adding a scoreboard.\\n\\nIn this project, I'm exploring various areas where I've identified gaps, such as deployment and architectural solutions, but perhaps these challenges go beyond the scope of a simple portfolio site. This continuous thought process keeps the site in a state of constant evolution.\\n\\nCurrently, I consider it a basic project with a strong emphasis on the frontend. I'm already planning to implement server-side rendering (SSR), considering both the use of React Router (already present on the site) and evaluating <hglt>Next.js</hglt> as an alternative.\\n\\nI started this repository a year ago, but it's only in the last three weeks that the site has come to life. I've rediscovered the joy of writing, simply <hglt>driven by the passion</hglt> for creation, and I encourage all my fellow developers to do the same.\"\n};\n/* harmony default export */ const __WEBPACK_DEFAULT_EXPORT__ = (messages);\n//# sourceURL=[module]\n//# sourceMappingURL=data:application/json;charset=utf-8;base64,\n//# sourceURL=webpack-internal:///./src/translations/en.js\n");

